from pytreemap import TreeSet
Input = ""
output=[]

for i in range(len(Input)):
    value = Input[i:i+14]
    c=''
    tree_set = TreeSet()
    for j in value:
        b  = tree_set.add(j)
        if b:
            c=c+j

    output.append(c)
    print(value)

#print(output)
value = ""
for j in output:
    if len(j)==14:
        value=j
        break

print(output.index(value)+14)







